import React from 'react'
import { useDispatch } from 'react-redux'


const Complete = () => {
    const dispatch = useDispatch();

    const onButtonRandomWheel = () => {
        dispatch({ type: 'pageReducer/SET_RANDOMWHEEL' })
    }

    return (
        <div className="containerDiv">
            <div className="rowDiv">
                <p>제출되었습니다.</p>
            </div>
            <div className="rowDiv">
                <button className="optionNextButton" onClick={onButtonRandomWheel}>돌림판 이동</button>
            </div>
        </div>
    );
}

export default Complete;
